import React, {Component} from "react";
import './Navbar.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import {Representatives} from './Representatives.js';
import {NavLink as RRNavLink, BrowserRouter} from 'react-router-dom';
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
    UncontrolledDropdown,
    DropdownToggle,
    DropdownMenu,
    DropdownItem } from 'reactstrap';

export class Navigation extends Component {
    constructor(props) {
      super(props);
    }
    render() {
      return (
        <div className="Navbar">
        <Navbar color="dark" dark expand="md">
          <NavbarBrand style={{color: '#c7cfd9', textDecoration: 'none'}} href="/">Empowering Knowledge</NavbarBrand>
            <Nav className="ml-auto" navbar>
                <BrowserRouter>
                    <NavLink  href="/about" class="nav-link">About</NavLink>
                </BrowserRouter>
              <NavItem>
                <BrowserRouter>
                    <NavLink href="/representatives" class="nav-link">Representatives</NavLink>
                </BrowserRouter>
              </NavItem>
              <NavItem>
              <BrowserRouter>
                    <NavLink href="/states" class="nav-link">States</NavLink>
                </BrowserRouter>
              </NavItem>
              <NavItem>
                <NavLink href="/energy-bills" class="nav-link">Energy Bills</NavLink>
              </NavItem>
         
            </Nav>
        </Navbar>
      
        
      </div>
      );
    }
}

export default Navigation;
